import React from 'react';
import ReactDOM from 'react-dom';


let today = new Date();
let dd = today.getDate();
let month=today.getMonth()+1;
let year = today.getFullYear();
let fDate = dd+'/'+month+'/'+year


ReactDOM.render(
  <>
    <h1>My Name is ,Saurav Kushwah</h1>
    <p>todays date is {fDate}</p>
    <p>todays time is{`${today.getHours}.${today.getMinutes}.${today.getSeconds}`}</p>
  </>, document.getElementById('root')
)
